import React from "react";

import "./sign-in.styles.scss";

class SignIn extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      email: "",
      password: "",
    };
  }
  render() {
    return (
      <div>
        <h2>I already have an account</h2>
        <span>Sign in with you email and password. </span>
      </div>
    );
  }
}

export default SignIn;
